import React from "react";
import "./Navbar.css";
import Button from "@mui/material/Button";
import { createTheme } from "@mui/material/styles";

const Navbar = () => {
  const theme = createTheme({
    palette: {
      primary: {
        light: "#757ce8",
        main: "#3f50b5",
        dark: "#002884",
        contrastText: "#fff",
      },
      secondary: {
        light: "#ff7961",
        main: "#f44336",
        dark: "#ba000d",
        contrastText: "#000",
      },
    },
  });

  return (
    <>
      <nav>
        <div className="nav-logo">Buisness Alive</div>
        <div className="content">Option</div>
        <div className="content">Option</div>
        <div className="content">Option</div>
        <div className="content">Option</div>
        <div className="content">Option</div>
        <div className="buttonGroup">
          <Button color="warning" className="primary" variant="outlined">
            Sign in
          </Button>
          <Button color="warning" className="" variant="contained">
            Sign up
          </Button>
        </div>
      </nav>
    </>
  );
};

export default Navbar;
